import { Content } from "./components/index";
import { Header, Hero, MostPopular,GamingLibrary,Footer } from "./sections/index";
import "./App.css";
import React from "react";
function App() {
  return (
    <>
      <Header />
      <Content>
        <>
          <Hero />
          <MostPopular />
          <GamingLibrary/>
        </>
      </Content>
      <Footer />
    </>
  );
}

export default App;
